import React from "react";
import './Navbar.css';
function Navbar(){
  return(
    <div className="navbar">

      <div className="nav-logo">
        <img src="./Assets/logo.png" alt="" />
        <p>SHOPPER</p>
      </div>
      <ul className="nav-menu">
        <li></li>
      </ul>
    </div>
  )
}
export default Navbar
